import React, { useEffect } from "react";
import styles from "../styles/card.module.css";
import Aos from "aos";

const TopBanner = ({ cardData, theme }) => {
  useEffect(() => {
    Aos.init({ duration: 500 });
  }, []);
  let topBannerImg;
  let profilePic;
  let topBannerStyle = { color: theme?.palette?.primary?.contrastText };
  const defaultBannerImg =
    "data:image/jpeg;base64,";
  const defaultProfilePic =
    "data:image/jpeg;base64,";

  return (
    <div
      data-aos="fade-in"
      className={{ cardData } ? styles.topBanner : styles.hidden}
    >
      <div className={styles.topBanner}>
        <img
          className={styles.topBanner}
          src={
            cardData?.images?.topBannerImg
              ? cardData?.images?.topBannerImg
              : defaultBannerImg
          }
          alt="main"
        />
      </div>
      <div className={styles.topText}>
        <div
          className={cardData?.name ? styles.topTextName : styles.hidden}
          style={topBannerStyle}
        >
          {cardData?.name}
        </div>
        <div className={styles.topTextTitle} style={topBannerStyle}>
          {cardData?.title}
        </div>
      </div>
      <div className={styles.profilePictureContainer}>
        <img
          className={styles.profilePicture}
          src={
            cardData?.images.profileImg
              ? cardData?.images?.profileImg
              : defaultProfilePic
          }
          alt=""
        />
      </div>
    </div>
  );
};

export default TopBanner;
